Fixing the departmental metadata required the following:

```
query = DSpace::CLI::SeniorThesisCommunity.find_by_class_year('2020')
sub_query = query.find_by_department('Mechanical & Aerospace Engr')
sub_query.results.each { |item| item.add_metadata('pu', 'department', 'Mechanical and Aerospace Engineering') }
sub_query.results.each { |item| item.remove_metadata('pu', 'department', 'Mechanical & Aerospace Engr') }
sub_query.results.each { |item| item.update }
```
